                <Input placeholder="input placeholder" />
            </Form.Item>
            <Form.Item {...tailLayout}>
                <Button type="primary">Submit</Button>
                <Button htmlType="button" onClick={() => onReset()}>Reset</Button>
            </Form.Item>
        </Form>

    )



}
